import { useState } from 'react';
import './App.css';
import Form from './Form';

function App() {
  const [textToggle, textToggleState] = useState(true)
  return (
    <div class="App">
       <button onClick={ () => textToggleState(!textToggle) }>Click me</button>
    <Form />
    </div>
  );
}

export default App;
